import React from "react";
import Header from "./components/Header";
import Hero from "./components/Hero";
import Comments from "./components/Comments";
import Footer from "./components/Footer";
// import "./styles/style.css";

function App() {
  return (
    <>
      <Header />
      <Hero />
      <Comments />
      <Footer />
    </>
  );
}

export default App;
